import React from "react";


class PhaseStateLegend extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div id="phaseStateLegend" className="floatLeft">
                <div className="phaseSymbol">
                    So
                </div>

                <div className="phaseSymbol">
                    Lq
                </div>

                <div className="phaseSymbol">
                    Gs
                </div>

                <div className="phaseSymbol">
                    Uk
                </div>
            </div>
        );
    }
}


export default PhaseStateLegend;
